import React from 'react';
import n from './Nav.module.css';

const Nav = () => {
  return (
    <nav className={n.nav}>
      <div>
        <a href='/profil'> Profile</a>
      </div>
      <div>
        <a>Massages</a>
      </div>
      <div>
        <a>News</a>
      </div>
      <div>
        <a>Music</a>
      </div>
      <div>
        <a>Settings</a>
      </div>
    </nav>
  );
};

export default Nav;
